import { Component, OnInit } from '@angular/core';
import { FormGroup, FormBuilder, Validators } from '@angular/forms';
import { UserService } from '../user-service.service';
import { ToastrService } from 'ngx-toastr';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from "pdfmake/build/vfs_fonts";
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-generate-certificate',
  templateUrl: './generate-certificate.component.html',
  styleUrls: ['./generate-certificate.component.scss']
})
export class GenerateCertificateComponent implements OnInit {
  public loading = false;
  generateCertificateForm: FormGroup;
  loginInvalid = false;
  participant_detail_invalid = true;
  fullname;
  documentDefinition;

  participant_detail;

  constructor(private fb: FormBuilder, private userService: UserService, private toastr: ToastrService) { }

  ngOnInit(): void {
    this.generateCertificateForm = this.fb.group({
      unique_id: ['', Validators.required],
      password: ['', Validators.required],
    })
  }

  loginForm() {
    this.loading = true;
    this.userService.loginUser(this.generateCertificateForm.value)
      .subscribe(resp => {
        if (!resp) {
          this.participant_detail_invalid = true;
          this.toastr.error('Invalid credentials ðŸ˜Ž')
          this.loginInvalid = true;
          this.loading = false;
          console.log('invalid login')
        } else {
          this.loading = false;
          this.participant_detail_invalid = false;
          // Get the user detail for certificate generation
          this.userService.getUser().subscribe(
            data => {
              this.participant_detail.first_name = data.first_name;
              this.participant_detail.last_name = data.last_name;
              this.loading = false;
              this.toastr.success("Your certificate has been successfully generated")
            },
            err => {
              this.toastr.error("Your certificate has failed to generate")
              this.loading = false;
            })
        }
      })

    this.participant_detail = {
      first_name: '',
      last_name: '',
    }
  }

  generatePdf() {
    this.fullname = `${this.participant_detail.first_name} ${this.participant_detail.last_name}`
    
    console.log("reached")
    this.documentDefinition = {
      pageSize: {
        width: 1000,
        height: 730
      },
      pageMargins: [0, 0, 0, 0],
      content: [
      {
        image: "data:image/jpeg;base64,",
        width: 1000,
        height: 730,
        margin: [0, 0, 0, 0]
      },
        {
          text: this.fullname.toUpperCase(),
          bold: true,
          fontSize: 30,
          color: '#494e63',
          uppercase: true,
          absolutePosition: { x: 123, y: 355 }
        }
    ]};
    pdfMake.createPdf(this.documentDefinition).download('cyberpeace-africa-cerficate.pdf');
  }
}
